function SearchFilters({ property }: any) {
  let title = property;
  if ((property = "for-sale")) {
    title = " for sale";
  }
  if ((property = "for-rent")) {
    title = " for sale";
  } else {
    title = "";
  }
  return (
    <div>
      {property ? (
        <h3> Searching Properties {title}</h3>
      ) : (
        <h3> Searching Properties</h3>
      )}
    </div>
  );
}
export default SearchFilters;
